sections.code:
* {
    -moz-tab-size: 4 !important;
}

/* For JSONView add-on */
body > div#json {
	line-height: 1.5em;
	font-size: 14px;
}

@media (prefers-color-scheme: dark) {
	body > div#json {
		margin: 0;
		background: #2d2d2d;
		color: #ccc;
	}

	body > div#json span.prop {
		font-weight: normal;
	}

	body > div#json span.num, body > div#json span.bool {
		color: #f08d49;
	}

	body > div#json span.string, body > div#json a {
		color: #7ec699;
	}	
}
